import React from 'react';

const Card = ({songUrl, imageUrl, songName}) => {
  
    return (
      <>
        <div className='tc grow bg-light-green br3 pa3 ma2 dib bw2 shadow-5'>
            <h3 className='fonty'>{songName}</h3>
              <img src={imageUrl} alt='singer name'/>
            <audio controls>
                <source 
                src={songUrl}
                type="audio/mp3"/>
            </audio>
            <br/>
        </div>    
      </>
      
    );
  }
  
  export default Card;
